	'messages:apihelp-compare-summary' => 'en:Get the difference between two pages.',
	'messages:apihelp-compare-extended-description' => 'en:A revision number, a page title, a page ID, text, or a relative reference for both "from" and "to" must be passed.',
	'messages:apihelp-compare-param-fromtitle' => 'en:First title to compare.',
